day = Math.floor(Date.now()/86400000) - 19058

function start(d) {
    playing = true

    if (d == -1 || d >= dailyGames.length) {
        game = games[Math.floor(games.length * Math.random())]
    }
    else {
        game = dailyGames[d]
    }
    a = game.split(' ')
    word = a[a.length - 1].toLowerCase()
    if (d == -1) {
        title = '(Random)'
    }
    else {
        date = new Date()
        title = `(${date.getDate()}-${date.getMonth()+1}-${date.getFullYear()})`
    }
    clue = game.substr(0, game.length - 5)

    guess = ''
    guessNumber = 0

    document.getElementsByClassName('clue')[0].innerText = title + '\n' + clue
}

function replaceAt(string, index, char) {
    return string.substr(0, index) + char + string.substr(index + 1)
}

function share() {
    var text = `Guydle ${title}\n${clue}\n`
    for(const word of document.getElementsByClassName('word')) {
        for(const letter of word.children) {
            if (letter.classList.contains('green')) {
                text += 'üü©'
            }
            else if (letter.classList.contains('yellow')) {
                text += 'üü®'
            }
            else {
                text += '‚¨õ'
            }
        }

        text += ' ||'

        for(const letter of word.children) {
            text += letter.innerHTML.toLowerCase()
        }
        text += '||\n'
    }
    text += 'https://iwverve.github.io/guydle/'
    copy(text)
}

function copy(text) {
    navigator.clipboard.writeText(text)
}

function win() {
    playing = false
    var shareButton = document.createElement('button')
    shareButton.classList.add('share')
    shareButton.innerText = 'Share Results'
    shareButton.onclick = share
    document.getElementsByClassName('game')[0].appendChild(shareButton)
}

function guessWord() {
    if (!words.includes(guess)) {
        return
    }

    w = word
    c = 0
    for(var i = 0; i < 5; i++) {
        if (guess[i] == w[i]) {
            document.getElementsByClassName('word')[guessNumber].children[i].classList.add('green')
            for(const key of document.getElementsByClassName('keyboard-key')) {
                if (key.innerText.toLowerCase() == guess[i]) {
                    key.classList.add('green')
                }
            }

            guess = replaceAt(guess, i, '-')
            w = replaceAt(w, i, '-')
            c++
        }
    }
    if (c == 5) {
        win()
        return
    }
    for(var i = 0; i < 5; i++) {
        if (guess[i] != '-') {
            inword = false
            for(var j = 0; j < 5; j++) {
                if (guess[i] == w[j]) {
                    document.getElementsByClassName('word')[guessNumber].children[i].classList.add('yellow')        
                    for(const key of document.getElementsByClassName('keyboard-key')) {
                        if (key.innerText.toLowerCase() == guess[i] && !key.classList.contains('green')) {
                            key.classList.add('yellow')
                        }
                    }
                    w = replaceAt(w, j, '-')
                    inword = true
                    break
                }
            }
            if (!inword) {
                for(const key of document.getElementsByClassName('keyboard-key')) {
                    if (key.innerText.toLowerCase() == guess[i]) {
                        key.classList.add('dark')
                    }
                }
            }
        }
    }
    addRow()
}

function addRow() {
    var word = document.createElement('div')
    word.classList.add('word')
    for(var i = 0; i < 5; i++) {
        var letter = document.createElement('div')
        letter.classList.add('letter')
        word.appendChild(letter)
    }
    document.getElementsByClassName('game')[0].appendChild(word)
    guessNumber++
    guess = ''
}

function pressKey(key) {
    if (playing) {
        if ((key.length == 1) && ((key >= 'a' && key <= 'z') || (key >= 'A' && key <= 'Z'))) {
            key = key.toLowerCase()
            if (guess.length < 5) {
                document.getElementsByClassName('word')[guessNumber].children[guess.length].innerText = key.toUpperCase()
                guess += key
            }
        }
        else if (key == 'Backspace') {
            if (guess.length > 0) {
                document.getElementsByClassName('word')[guessNumber].children[guess.length - 1].innerText = ''
                guess = guess.substr(0, guess.length - 1)
            }
        }
        else if (key == 'Enter') {
            if (guess.length == 5) {
                guessWord()
            }
        }
    }
}

document.addEventListener('keydown', function press(e) {
    pressKey(e.key)
})

